import "./App.css";
import Header from "./components/Header";
import Post from "./components/Post";

import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Routes></Routes>
      <main>
        <Header />
        <Post />
      </main>
    </>
  );
}

export default App;
